package main

import (
	"fmt"
)

var save_jumps_from_index map[int]int

func min(a, b int) int {
	if a < b {
		return a
	}
	return b
}

func solve(nums []int, index int) int {
	fj := 0
	A := 0
	if index < len(nums)-1 {
		fj = 10000
		A = 0
		for i := 0; i < nums[index] && index+i+1 < len(nums); i++ {
			if val, ok := save_jumps_from_index[index+i+1]; ok {
				A = val
			} else {
				A = solve(nums, index+i+1)
			}
			fmt.Printf("@%d -> %d (%d)\n", nums[index], A+1, index+i+1)
			fj = min(fj, A+1)
		}
	}
	if fj == 0 {
		fmt.Printf("@BASE CASE %d -> %d\n", nums[index], A+1)
	}
	save_jumps_from_index[index] = fj
	return fj

}

func jump(nums []int) int {

	save_jumps_from_index = make(map[int]int)
	return solve(nums, 0)

}

